insert into inm_arriendo values (2, 4.724344793915505, -74.04424934250454, "ENTRE_10_A_20", 142.20, 3, "Los cedros", "Primer nivel: Sala comedor, chimenea, baño social, cocina integral tipo americano, balcón, zona de lavandería, cuarto y baño de servicio. Segundo nivel: Tres habitaciones cada una con closet, dos de ellas con balcón, la principal con baño privado y tina, un baño social. Apartameto 505, garaje 7 y 16, deposito 7", "Calle 142 N°17A-06", "DISPONIBLE", 4, "2022-12-20", 3, "2 duplex", "APARTAMENTOS", 2510000, "Usaquen", "50N-20488310", 1, "https://drive.google.com/file/d/1ssz76tx6cL8UV0wcPuVC-OMU5oIF8OVo/view?usp=drive_link");
insert into inm_arriendo values (3, 4.656609879987514, -74.10655774994757, "ENTRE_10_A_20", 115.21, 2, "Salitre plaza", "La oficina se encuentra en el piso 4 en el centro comercial y de negocios torre central, edificio inteligente,cuenta con piso en alfombra, aire acondicionado, excelente iluminación y ventilación, consta de  dos baños uno de ellos con ducha, sala de juntas, cocina integral, espacios para oficinas. Dos parqueaderos de uso exclusivo. Oficina 404, garaje 120 y 121", "Calle 26 N°68C-61", "DISPONIBLE", 4, "2022-12-20", 0, "1 nivel", "OFICINAS", 6830000, "Fontibón", "50C-1648840", 1,"https://drive.google.com/file/d/1zdIV_kI4FdhpMcx58gsupM2Dj9Guaip0/view?usp=drive_link");
